512.85Q245.07 469.92%2c 288 498.99Q344.87 483.86%2c 360 540.72Q431.06 491.78%2c 480 562.83Q513.97 476.8%2c 600 510.76Q644.04 482.8%2c 672 526.83Q713.5 496.33%2c 744 537.82Q825.53 499.36%2c 864 580.89Q890.31 487.2%2c 984 513.52Q1025.04 482.56%2c 1056 523.6Q1102.05 497.65%2c 1128 543.71Q1167.69 463.4%2c 1248 503.09Q1290.92 474.01%2c 1320 516.93Q1377.03 501.96%2c 1392 559Q1424.32 471.32%2c 1512 503.64z' fill='white'%3e%3c/path%3e%3c/g%3e%3cdefs%3e%3cmask id='SvgjsMask1000'%3e%3crect width='1440' height='560' fill='white'%3e%3c/rect%3e%3c/mask%3e%3c/defs%3e%3c/svg%3e");
            <div data-aos="fade-right" data-aos-duration="1500" className="flex w-[550px] gap-8 justify-start items-center">
                <img className='floating' src={manIMG} alt="" />
